import React from 'react'
import '../css/styles.css'
import Header from '../components/Header'



const MyApp = ({ Components, pageProps }) => {
    return (
      <div>
     <Header />
        <div className='container mx-auto'>
      < Components  {...pageProps} />
         </div>

         </div>
        

    )
}
